//www.pikl.com/",openInNewTab:!0,smoothScroll:!1,children:r("a",{children:"Pikl"})}),", a specialist insurer for short-term holiday lets (UK only)."]})})},{id:"gSXfAIQ7_",nZdfNYhy8:"House rules",nZdIeGEGP:"house-rules",zaIif1Tzy:r(e,{children:r("p",{children:"These are set by the host to cover anything that\u2019s important for guests to know during their stay at a property. They are an ideal opportunity to clearly set out any expectations, to outline what guests can and cannot do at the property and what penalties will occur if the house rules are broken."})})},{id:"nGtEb2iwI",nZdfNYhy8:"iCal connection",nZdIeGEGP:"ical-connection",zaIif1Tzy:r(e,{children:r("p",{children:"A connection used to synchronize calendars with closed periods to block periods of unavailability."})})},{id:"LZ_XZ3X0r",nZdfNYhy8:"Instant book",nZdIeGEGP:"instant-book",zaIif1Tzy:r(e,{children:r("p",{children:"A popular reservation method which does not require approval from the host before guests can book a property. Guests can choose their travel dates, book and pay without speaking to the host first."})})},{id:"tS07_rnNY",nZdfNYhy8:"Inventory",nZdIeGEGP:"inventory",zaIif1Tzy:r(e,{children:r("p",{children:"A term used to describe a group of properties an owner or host has available for guests to book.\xA0"})})},{id:"c7lmWAvZt",nZdfNYhy8:"Invoice",nZdIeGEGP:"invoice",zaIif1Tzy:r(e,{children:r("p",{children:"A document which helps guests keep track of their expenses and can be also used as proof of payment."})})},{id:"QWXVc67bj",nZdfNYhy8:"Key exchange",nZdIeGEGP:"key-exchange",zaIif1Tzy:r(e,{children:r("p",{children:"When a host meets guests at the beginning and end of their stay to give and collect keys for the property."})})},{id:"hQuBpqC6H",nZdfNYhy8:"Keyless entry",nZdIeGEGP:"keyless-entry",zaIif1Tzy:r(e,{children:r("p",{children:"A way for guests to gain access to a property without the need for keys. Hosts can send a temporary passcode to guests to allow them to access the property, removing the need for face-to-face interaction."})})},{id:"H6ZuuLr44",nZdfNYhy8:"Licence",nZdIeGEGP:"licence",zaIif1Tzy:r(e,{children:r("p",{children:"Also see Tourist licence. In some countries e.g. Spain, France and Portugal, a license is legally required before a property can be used as a short-term vacation rental."})})},{id:"TjSzxk5VP",nZdfNYhy8:"Listing",nZdIeGEGP:"listing",zaIif1Tzy:r(e,{children:r("p",{children:"This describes the profile of a property on a listing site or Online Travel Agency (OTA) and generally includes a title, description, photos and pricing."})})},{id:"hq8BJwGOp",nZdfNYhy8:"Listing site",nZdIeGEGP:"listing-site",zaIif1Tzy:r(e,{children:r("p",{children:"Also known as Online Travel Agencies (OTAs) or booking sites, these are third-party agents that list and advertise vacation rental properties through their own network. Vrbo and Expedia are examples of vacation rental listing sites."})})},{id:"a63VOGmmn",nZdfNYhy8:"Lockbox",nZdIeGEGP:"lockbox",zaIif1Tzy:r(e,{children:r("p",{children:"A small safe that is attached to a vacation rental property (usually near the entrance), which contains the keys to the\xA0 property, cutting down the need for face-to-face interaction between the host and guests."})})},{id:"Od2rqRWV0",nZdfNYhy8:"Low season",nZdIeGEGP:"low-season",zaIif1Tzy:r(e,{children:r("p",{children:"Also known as off-peak season, this refers to the time of year when travel is less common, resulting in fewer bookings for vacation rental properties. Rates are often reduced during the low season to attract bookings and remain competitive."})})},{id:"zzU6h14Qf",nZdfNYhy8:"Maintenence",nZdIeGEGP:"maintenence",zaIif1Tzy:r(e,{children:r("p",{children:"Regular works carried out on a property to ensure it remains in good working order e.g. heating, plumbing, renovations, garden/outside works etc."})})},{id:"DPqDFFIzP",nZdfNYhy8:"Mapping",nZdIeGEGP:"mapping",zaIif1Tzy:r(e,{children:r("p",{children:"The synchronisation of information about a property fr